    data: |
      SELECT DISTINCT - - 49 + col0 * - + 65 AS col2, + ( - 3 ) AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q13080.out
    data: |
      -2941	-3
      -4111	-3
      -4826	-3
